    <script>
      $(function() {
        $("a:has(img.gallery_A)").click(function() {
          var largePath_A = $(this).attr("href");
          var largePath_B = largePath_A.replace("_A","_B");
          var largePath_dif = largePath_A.replace("_A","_dif");
          $("#photoLarge_A").attr({src: largePath_A });
          $("#photoLarge_B").attr({src: largePath_B });
          $("#photoLarge_dif").attr({src: largePath_dif });
          return false;
        });
      });

      $(function() {
        $("a:has(img.gallery_B)").click(function() {
          var largePath_B = $(this).attr("href");
          var largePath_A = largePath_B.replace("_B","_A");
          var largePath_dif = largePath_B.replace("_B","_dif");
          $("#photoLarge_A").attr({src: largePath_A });
          $("#photoLarge_B").attr({src: largePath_B });
          $("#photoLarge_dif").attr({src: largePath_dif });
          return false;
        });
      });

      $(function() {
        $("a:has(img.gallery_dif)").click(function() {
          var largePath_dif = $(this).attr("href");
          var largePath_A = largePath_dif.replace("_dif","_A");
          var largePath_B = largePath_dif.replace("_dif","_B");
          $("#photoLarge_A").attr({src: largePath_A });
          $("#photoLarge_B").attr({src: largePath_B });
          $("#photoLarge_dif").attr({src: largePath_dif });
          return false;
         });
      });
    </script>
